import React from "react";
import { Flex, Image } from "@chakra-ui/react";
import logo from "../assets/logo.png";

const NavBar = () => {
    return(
        <>
        <Flex as='nav' bg='tomato' w="100%" height="10%">
            <Image src={logo} alt="solo mina corp"></Image>
        </Flex>
        </>
    )
};

export default NavBar;
